import { Button } from "@mui/material";
import React from "react";
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();
  return (
    <div>
      <h1 style={{ textAlign: "center" }}>Welcome to the Book Store</h1>
      <Button
        marginLeft="auto"
        marginRight="auto"
        variant="contained"
        onClick={() => navigate("/allbooks")}
      >
        Explore All Books
      </Button>
    </div>
  );
}

export default Home;
